private void printHits(Query query) throws IOException {
  Hits hits = searcher.search(query);
  System.out.print("new int[] {");
  for (int i = 0; i < hits.length(); i++) {
    System.out.print(hits.id(i));
    if (i != hits.length()-1)
      System.out.print(", ");
  }
  System.out.println("}");
}

